import React, {useEffect, useState} from 'react';

const Giphy = () => {
    useEffect(() => {
        const fetchData = async () => {
            axios("api.giphy.com/v1/gifs/trending", {
                params: {
                    api_key: "bnia5D6xRz5oesNByLQWUMu5o9aT8wKt"
                }
            })
        }

    })
    return <div className="">Giphy</div>
}
